import React from 'react';
import { Link } from 'react-router-dom';
import { Avatar, TextField, Typography } from '@mui/material';
import LockRoundedIcon from '@mui/icons-material/LockRounded';
import { makeStyles } from "@mui/styles";
import Paper from '@mui/material/Paper';
import Grid from "@mui/material/Grid" 
import ThemeSwitchInput from './UniversalInputs/ThemeSwitch';
import FormControl from '@mui/material/FormControl';

function Copyright() {
    return (
      <Typography variant="body2" color="text.secondary" align="center">
        {"Copyright © "}
        <Link color="inherit" href="https://mui.com/">
          Your Website
        </Link>{" "}
        {new Date().getFullYear()}
        {"."}
      </Typography>
    );
}

const useStyles = makeStyles((theme) => ({
}));


function FORMLOGIN() {
  return(    
    <FormControl >
      <TextField id="outline-email" label="Email: " variant='outlined' required/>
      <TextField id="outline-email" label="Password:"  type='Password' variant='outlined' required/>
    </FormControl>
  );
}

export default function Login() {
  return (
      <Grid container sx={{width:'100%', backgroundColor: '#5A5A5A', justifyContent: "center"}}>
        <ThemeSwitchInput />
        <Grid
          item
          xs={12}
          sm={8}
          md={5}
          component={Paper}
          elevation={3}
          square={false}
          sx={{
            display: 'flex', 
            justifyContent: 'center ', 
            width: '100%'
        }}
        >
          <div >
            <Avatar justifyContent="center">
              <LockRoundedIcon />
            </Avatar>
            <Typography align="center" h="h1" variant="h5">
              Sign in
            </Typography>
            <FORMLOGIN />
            <Copyright />
          </div>
        </Grid>
      </Grid>
  );
}
